		display: "flex",
		justifyContent: "space-between",
		"& h1": {
			marginLeft: 20,
			fontFamily: "Open Sans Condensed",
			fontSize: 54,
			marginBottom: 30,
		},
		"& span": {
			marginLeft: 50,
			fontSize: 40,
			lineHeight: "53.2px",
			color: colors.blackGrey,
		},
	},
});

